import FetchData from './lookup/components';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="container">
        <FetchData />
        <hr />
        <Switch>
          <Route path="/contacto">
            Pagina de contacto
          </Route>
          <Route path="/nosotros">
            Pagina de contacto
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
